import React from 'react';
import './Projects.css'; // Импорт на CSS стилове

const ProjectComponent = ({ project }) => {
    return (
        <div className="project-card">
            <div className="project-info">
                <h2>{project.title}</h2>
                <p><strong>EIK:</strong> {project.eik}</p>
                <p><strong>Address:</strong> {project.address}</p>
                <p><strong>Parcel Area:</strong> {project.parcelArea} m²</p>
                <p><strong>Start Date:</strong> {project.startDate}</p>
                <p><strong>End Date:</strong> {project.endDate}</p>
                <p><strong>Building Count:</strong> {project.buildingCount}</p>
                <p><strong>Status:</strong> {project.buildingStatus}</p>
            </div>
        </div>
    );
};

export default ProjectComponent;
